import { Component } from '@angular/core';
import { IMenuCafe } from '../models/menuCafeInterface'
import { MenuCafe as mydata } from '../data/menuCafe'

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  Dishes: IMenuCafe[] = mydata;
}
<div class="d-flex flex-column">
  <div class="container d-flex flex-row" *ngFor="let dish of Dishes; index as i">
    <app-menuCafe ></app-menuCafe>
  </div>
</div>
